import { useState, useEffect } from "react";
import { parseGIF, decompressFrames } from "gifuct-js";
import '../stylesheets/Frames.css';

export default function DecryptSection() {
  const [file, setFile] = useState(null);
  const [fileName, setFileName] = useState('');
  const [error, setError] = useState(null);
  const [metadata, setMetadata] = useState(null);

  const handleGIFChange = (e) => {
    const gifFile = e.target.files[0];
    if (!gifFile) return;
    if (gifFile.type !== 'image/gif') {
      setError("Please upload a valid GIF file");
      return;
    }
    setFile(gifFile);
    setFileName(gifFile.name);
    setError(null);
  };

  const extractMetadataBits = async (gifFile) => {
    const arrayBuffer = await gifFile.arrayBuffer();
    const gif = parseGIF(arrayBuffer);
    const frames = decompressFrames(gif, true);

    // Extract LSBs from first pixel of each frame
    let allBits = '';
    for (let i = 0; i < frames.length; i++) {
      allBits += (frames[i].patch[0] & 1).toString();
    }

    const framesCount = frames.length;
    const totalBitsCollected = allBits.length;

    // Get metadata length from first 32 bits (try both endianness)
    const lengthBits = allBits.slice(0, 32);
    const metadataLengthBE = lengthBits ? parseInt(lengthBits, 2) : 0;
    const metadataLengthLE = lengthBits ? parseInt(lengthBits.split('').reverse().join(''), 2) : 0;

    // Choose which length to use (prefer BE if non-zero)
    let usedMetadataLength = metadataLengthBE || metadataLengthLE;
    let usedEndian = metadataLengthBE ? 'big-endian' : (metadataLengthLE ? 'little-endian' : 'none');

    // If parsed length is zero, fallback to using the remainder of bits
    let metadataBits = '';
    if (!usedMetadataLength) {
      metadataBits = allBits.slice(32);
      usedMetadataLength = metadataBits.length;
      usedEndian = 'fallback-rest';
    } else {
      // clamp if length longer than available bits
      const available = allBits.length - 32;
      const clampLen = Math.min(usedMetadataLength, available);
      metadataBits = allBits.slice(32, 32 + clampLen);
      if (usedMetadataLength > available) usedMetadataLength = clampLen;
    }

    console.log('Frames count:', framesCount);
    console.log('Total bits collected:', totalBitsCollected);
    console.log('Length bits raw:', lengthBits);
    console.log('Parsed length (BE):', metadataLengthBE);
    console.log('Parsed length (LE):', metadataLengthLE);
    console.log('Using length (bits):', usedMetadataLength, '(', usedEndian, ')');
    console.log('Raw metadata bits:', metadataBits);

    // Helper: pad to whole bytes and convert bits -> Uint8Array
    const bitsToUint8Array = (bits) => {
      let s = bits;
      while (s.length % 8 !== 0) s += '0';
      const bytes = new Uint8Array(s.length / 8);
      for (let i = 0; i < bytes.length; i++) {
        const byte = s.slice(i * 8, i * 8 + 8);
        bytes[i] = parseInt(byte, 2);
      }
      return bytes;
    };

    const byteArray = bitsToUint8Array(metadataBits);
    let metadataString = '';
    try {
      metadataString = new TextDecoder().decode(byteArray);
    } catch (e) {
      console.warn('Failed to decode metadata as UTF-8:', e);
      metadataString = '';
    }

    console.log('Decoded metadata string:', metadataString);

    return { framesCount, totalBitsCollected, lengthBits, metadataLengthBE, metadataLengthLE, usedMetadataLength, usedEndian, metadataBits, metadataString };
  };

  const handlePrintMetadata = () => {
    if (!file) return;
    extractMetadataBits(file)
      .then((result) => {
        console.log('--- Metadata ---');
        console.log(result);
        setMetadata(result.metadataString || '');
      })
      .catch(err => setError(err.message));
  };

  return (
    <div>
      <input type="file" accept="image/gif" onChange={handleGIFChange} />
      {fileName && <p>Uploaded GIF: {fileName}</p>}

      {file && (
        <button onClick={handlePrintMetadata}>
          Print Metadata Bits to Console
        </button>
      )}

      {metadata !== null && (
        <div style={{ marginTop: '8px' }}>
          <strong>Decoded Metadata:</strong>
          <div style={{ whiteSpace: 'pre-wrap', marginTop: '4px' }}>{metadata || <em>(empty)</em>}</div>
        </div>
      )}
      {error && <p style={{ color: "red" }}>{error}</p>}
    </div>
  );
}
